pragma solidity ^0.8.0;


library BytesAndKeccakLib {
    function pureBytes(bytes memory in_) public pure returns (bytes32 k_) {
        k_ = keccak256(in_);
     }
    function pureString(string memory in_) public pure returns (bytes32 k_) {
        return pureBytes(bytes(in_));
    }
    function pureBytes32Array(bytes32[] memory in_)
        public
        pure
        returns (bytes32 k_)
    {
        return pureBytes(Bytes32ArrayToBytes(in_));
    }
    function pureAddressUInt256(address addr_, uint256 v_)
        public
        pure
        returns (bytes32 k_)
    {
        return pureBytes32Array(AddressUInt256ToBytes32Array(addr_, v_));
    }
    function pureBytes32Address(bytes32 v_, address addr_)
        public
        pure
        returns (bytes32 k_)
    {
        return pureBytes32Array(Bytes32AddressToBytes32Array(v_, addr_));
    }
    function pureBytes32Bytes32(bytes32 v1_, bytes32 v2_)
        public
        pure
        returns (bytes32 k_)
    {
        return pureBytes32Array(Bytes32Bytes32ToBytes32Array(v1_, v2_));
    }
    function Bytes32ArrayToBytes(bytes32[] memory in_)
        public
        pure
        returns (bytes memory out_)
    {
        out_ = new bytes(in_.length * 32);
        for (uint256 i = 1; i <= in_.length; i++)
            assembly {
                mstore(add(out_, mul(32, i)), mload(add(in_, mul(32, i))))
            }
    }
    function AddressUInt256ToBytes32Array(address addr_, uint256 v_)
        public
        pure
        returns (bytes32[] memory out_)
    {
        out_ = new bytes32[](2);
        out_[0] = bytes32(uint256(uint160(addr_)));
        out_[1] = bytes32(v_);
    }
    function Bytes32AddressToBytes32Array(bytes32 v_, address addr_)
        public
        pure
        returns (bytes32[] memory out_)
    {
        out_ = new bytes32[](2);
        out_[0] = v_;
        out_[1] = bytes32(uint256(uint160(addr_)));
    }
    function Bytes32Bytes32ToBytes32Array(bytes32 v1_, bytes32 v2_)
        public
        pure
        returns (bytes32[] memory out_)
    {
        out_ = new bytes32[](2);
        out_[0] = v1_;
        out_[1] = v2_;
    }
    function BytesToBytes32Array(bytes memory in_)
        public
        pure
        returns (bytes32[] memory out_)
    {
        require(in_.length % 32 == 0, "BytesAndKeccakLib BytesToBytes32Array Invalid Resolving");
        out_ = new bytes32[](in_.length / 32);
        for (uint256 i = 1; i <= in_.length / 32; i++)
            assembly {
                mstore(add(out_, mul(32, i)), mload(add(in_, mul(32, i))))
            }
    }
    function Bytes32ArrayToAddressUInt256(bytes32[] memory in_)
        public
        pure
        returns (address addr_, uint256 v_)
    {
        require(in_.length == 2, "BytesAndKeccakLib Bytes32ArrayToAddressUInt256 Invalid Resolving");
        addr_ = address(uint160(uint256(in_[0])));
        v_ = uint256(in_[1]);
    }
    function Bytes32ArrayToBytes32Bytes32(bytes32[] memory in_)
        public
        pure
        returns (bytes32 v1_, bytes32 v2_)
    {
        require(in_.length == 2, "BytesAndKeccakLib Bytes32ArrayToBytes32Bytes32 Invalid Resolving");
        v1_ = in_[0];
        v2_ = in_[1];
    }
    function Bytes32ArrayToBytes32Address(bytes32[] memory in_)
        public
        pure
        returns (bytes32 v_, address addr_)
    {
        require(in_.length == 2, "BytesAndKeccakLib Bytes32ArrayToBytes32Address Invalid Resolving");
        v_ = in_[0];
        addr_ = address(uint160(uint256(in_[1])));
    }

}
